static ImFont *AddLektonRegularFont(double scale_factor)
{
    ImFontConfig config;
    config.OversampleH = 1;
    config.OversampleV = 1;
    //config.PixelSnapH = true;
    config.SizePixels = 16 * scale_factor;
    //config.GlyphExtraSpacing.x = 1;

    // font name variable
    const char *name = "LektonRegularMedium.ttf, 16px";
    char *dst = config.Name;

    while (*name)
        *dst++ = *name++;
    *dst = '\0';

    return ImGui::GetIO().Fonts->AddFontFromMemoryCompressedBase85TTF(LektonRegularFont_compressed_data_base85, config.SizePixels, &config);
}

